import React from 'react';
import './style/watch.css'


class Editwatchlist extends React.Component {


    addmovies(event) {
        console.log(event.target.div)
        console.log(this.props.key)
    }

    render() {
        let watchlistElements = [];
        for (let i = 0; i < 5; i++) {
            watchlistElements.push(<div id="watchedit"><input type="text" id="movieinput"/></div>)
        }

        return(
            <div className="editwatch">
                {watchlistElements}
                <button onClick={this.addmovies}>Add</button>
            </div>
        )
    }
}

export default Editwatchlist
